M=4294967311

def pmod(v):
	return (v%M+M)%M

def mpow(x,N):
	res=1
	while (N>0):
		if(N%2):
			res=pmod(res*x)
		x=pmod(x*x)
		N/=2
	return res

def minv(a):
	return mpow(a,M-2)

