def isCat(S):
    #print(S)
    if len(S) == 0:
        return True
    if S[0] != "m" or S[-1] != "w":
        return False
    c = 0
    i=0
    for i in range(1,len(S)-1):
        if S[i] == 'm':
            c += 1
        elif S[i] == 'w':
            c -= 1
        if c ==0:
            break
    if S[1] == 'e':
        i = 0
    return S[i+1] == 'e' and isCat(S[1:i+1]) and isCat(S[i+2:-1])

if(isCat(input())):
    print("Cat")
else:

    print("Rabbit")

